"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[28346],{38675:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/200","metadata":{"permalink":"/en/release/200","source":"@site/i18n/en/docusaurus-plugin-content-blog/200.mdx","title":"v2.0.0","description":"AI Builder feature has been added.","date":"2025-10-10T00:00:00.000Z","formattedDate":"October 10, 2025","tags":[],"readingTime":0.425,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v2.0.0","last_update":"2025-10-10T00:00:00.000Z","date":"2025-10-10T00:00:00.000Z"},"nextItem":{"title":"v1.9.0","permalink":"/en/release/190"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### AI Builder feature has been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. AI Builder feature has been added.\\n\\n    - Instead of designing infrastructure by dragging and dropping resource icons, the AI Builder allows you to design infrastructure through simple text input.\\n    - AI Builder analyzes the given requirements, suggests optimized cloud resources, and automatically generates deployment diagrams.\\n    - The architecture generated by AI Builder can be further modified and refined by the user.\\n\\n</div>\\n<br/>"},{"id":"/190","metadata":{"permalink":"/en/release/190","source":"@site/i18n/en/docusaurus-plugin-content-blog/190.mdx","title":"v1.9.0","description":"CloudStudio and CS Checker have been integrated.","date":"2025-08-19T00:00:00.000Z","formattedDate":"August 19, 2025","tags":[],"readingTime":0.4,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.9.0","last_update":"2025-8-19","date":"2025-8-19"},"prevItem":{"title":"v2.0.0","permalink":"/en/release/200"},"nextItem":{"title":"v1.8.0","permalink":"/en/release/180"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### CloudStudio and CS Checker have been integrated.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. You can now use the CS Checker feature within CloudStudio.\\n\\n    - CS Checker provides cloud infrastructure asset registry, asset comparison, and asset visualization, as well as\\n      vulnerability assessment, monitoring, and report generation in the console inspection area. It is an integrated cloud security management service.\\n    - Now, CS Checker\u2019s features are available directly in CloudStudio.\\n\\n</div>\\n<br/>"},{"id":"/180","metadata":{"permalink":"/en/release/180","source":"@site/i18n/en/docusaurus-plugin-content-blog/180.mdx","title":"v1.8.0","description":"Pro subscription is now available for free for a limited time.","date":"2025-08-01T00:00:00.000Z","formattedDate":"August 1, 2025","tags":[],"readingTime":0.67,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.8.0","last_update":"2025-8-1","date":"2025-8-1"},"prevItem":{"title":"v1.9.0","permalink":"/en/release/190"},"nextItem":{"title":"v1.7.0","permalink":"/en/release/170"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Pro subscription is now available for free for a limited time.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"changed\\">\\n    Update\\n</div>\\n\\n1. The Pro subscription is now available for free for a limited time.\\n   - The Pro subscription includes access to all features:\\n      - Canvas drawing\\n      - Cost calculation\\n      - Vulnerability scanning\\n      - Infrastructure import\\n      - Infrastructure deployment (Terraform plan, apply)\\n      - AI infrastructure review\\n      - C2C canvas conversion\\n\\n</div>\\n<br/>\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. AI guidance for Terraform errors has been added.\\n   - When using the deployment check (plan) or deployment (apply) features, AI will analyze any Terraform errors and provide solutions.\\n\\n2. Kubernetes resource information is now available.\\n   - You can view Get, Logs, and Events for deployed Kubernetes resources.\\n\\n</div>\\n<br/>"},{"id":"/170","metadata":{"permalink":"/en/release/170","source":"@site/i18n/en/docusaurus-plugin-content-blog/170.mdx","title":"v1.7.0","description":"Kubernetes Import Feature Added","date":"2025-06-16T00:00:00.000Z","formattedDate":"June 16, 2025","tags":[],"readingTime":0.375,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.7.0","last_update":"2025-6-16","date":"2025-6-16"},"prevItem":{"title":"v1.8.0","permalink":"/en/release/180"},"nextItem":{"title":"v1.6.1","permalink":"/en/release/161"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Kubernetes Import Feature Added\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. Kubernetes Import Feature Added\\n    - The import feature has been added for Kubernetes Providers, enabling visualization of deployed Kubernetes resources.\\n        - Supported: AKS (Microsoft Azure), EKS (AWS), NKS (Naver Cloud)\\n    - Imported Kubernetes resources can be converted into Terraform code.\\n    - You can generate a Terraform state file using the Create tfstate feature.\\n\\n</div>\\n<br/>"},{"id":"/161","metadata":{"permalink":"/en/release/161","source":"@site/i18n/en/docusaurus-plugin-content-blog/161.mdx","title":"v1.6.1","description":"Deploy Separately Using Terraform Workspaces","date":"2025-05-23T00:00:00.000Z","formattedDate":"May 23, 2025","tags":[],"readingTime":0.305,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.6.1","last_update":"2025-5-23","date":"2025-5-23"},"prevItem":{"title":"v1.7.0","permalink":"/en/release/170"},"nextItem":{"title":"v1.6.0","permalink":"/en/release/160"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Deploy Separately Using Terraform Workspaces\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. You can now use Terraform Workspaces to manage infrastructure deployments for different environments separately.\\n    - Create and delete Terraform Workspaces as needed.\\n    - Deploy infrastructure per environment by isolating state files for each Workspace (e.g., dev, staging, production).\\n\\n</div>\\n<br/>"},{"id":"/160","metadata":{"permalink":"/en/release/160","source":"@site/i18n/en/docusaurus-plugin-content-blog/160.mdx","title":"v1.6.0","description":"Terraform Enterprise integration is now supported.","date":"2025-02-07T00:00:00.000Z","formattedDate":"February 7, 2025","tags":[],"readingTime":0.27,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.6.0","last_update":"2025-2-7","date":"2025-2-7"},"prevItem":{"title":"v1.6.1","permalink":"/en/release/161"},"nextItem":{"title":"v1.5.1","permalink":"/en/release/151"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Terraform Enterprise integration is now supported.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. Terraform Enterprise version integration is now supported.\\n\\n    - Terraform Cloud and Enterprise versions are supported as plugins for deployment management.\\n    - A hosted endpoint is required for Terraform Enterprise integration.\\n\\n</div>\\n<br/>"},{"id":"/151","metadata":{"permalink":"/en/release/151","source":"@site/i18n/en/docusaurus-plugin-content-blog/151.mdx","title":"v1.5.1","description":"A deployment and import notification service has been added.","date":"2025-01-23T00:00:00.000Z","formattedDate":"January 23, 2025","tags":[],"readingTime":0.48,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.5.1","last_update":"2025-1-23","date":"2025-1-23"},"prevItem":{"title":"v1.6.0","permalink":"/en/release/160"},"nextItem":{"title":"v1.5.0","permalink":"/en/release/150"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### A deployment and import notification service has been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. A deployment and import notification service has been added.\\n\\n    - A notification email will be sent upon completion of the deployment and import process.\\n    - Terraform plugin integration is required to enable the notification service.\\n\\n</div>\\n<br/>\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"changed\\">\\n    Update\\n</div>\\n\\n2. A new format for AI infrastructure review reports has been added.\\n\\n    - Markdown format is now additionally available when downloading AI infrastructure review reports.\\n\\n</div>"},{"id":"/150","metadata":{"permalink":"/en/release/150","source":"@site/i18n/en/docusaurus-plugin-content-blog/150.mdx","title":"v1.5.0","description":"The AI service has been added.","date":"2024-12-01T00:00:00.000Z","formattedDate":"December 1, 2024","tags":[],"readingTime":0.43,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.5.0","last_update":"2024-12-01T00:00:00.000Z","date":"2024-12-01T00:00:00.000Z"},"prevItem":{"title":"v1.5.1","permalink":"/en/release/151"},"nextItem":{"title":"v1.4.1","permalink":"/en/release/141"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### The AI service has been added.\\n\\n[**Go to AI Docs**](https://docs.cstudio.app/en/docs/ai/text-to-infra)\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. The AI service has been added.\\n    - Text to Infrastructure: You can create infrastructure through text using generative AI when creating a project.\\n    - AI Infrastructure Review: Easily understand the current state and areas for improvement of the configured infrastructure.\\n    - AI Chatbot: You can inquire about how to use CloudStudio and ways to improve infrastructure through the chatbot.\\n\\n</div>"},{"id":"/141","metadata":{"permalink":"/en/release/141","source":"@site/i18n/en/docusaurus-plugin-content-blog/141.mdx","title":"v1.4.1","description":"The VCS Integration features for Github and Gitlab have been updated.","date":"2024-09-23T00:00:00.000Z","formattedDate":"September 23, 2024","tags":[],"readingTime":0.225,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.4.1","last_update":"2024-09-23T00:00:00.000Z","date":"2024-09-23T00:00:00.000Z"},"prevItem":{"title":"v1.5.0","permalink":"/en/release/150"},"nextItem":{"title":"v1.4.0","permalink":"/en/release/140"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### The VCS Integration features for Github and Gitlab have been updated.\\n\\n[**Go to VCS Integration**](https://docs.cstudio.app/en/docs/plugin/vcs/add-github)\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"changed\\">\\n    Update\\n</div>\\n\\n1. VCS Integration\\n    - The integration features for Github and Gitlab have been updated.\\n\\n</div>"},{"id":"/140","metadata":{"permalink":"/en/release/140","source":"@site/i18n/en/docusaurus-plugin-content-blog/140.mdx","title":"v1.4.0","description":"Monitoring functionality has been added.","date":"2024-07-19T00:00:00.000Z","formattedDate":"July 19, 2024","tags":[],"readingTime":0.435,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.4.0","last_update":"2024-07-19T00:00:00.000Z","date":"2024-07-19T00:00:00.000Z"},"prevItem":{"title":"v1.4.1","permalink":"/en/release/141"},"nextItem":{"title":"v1.3.1","permalink":"/en/release/131"}},"content":"import styles from \'/src/scss/_markdown.module.scss\';\\n\\n<hr/>\\n\\n#### Monitoring functionality has been added.\\n#### Additional supported service languages have been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. Metric monitoring for deployed resources has been added.  \\n   - Supported CSPs: Azure, AWS, Ncloud\\n2. Japanese language support has been added.\\n\\n\\n</div>\\n<br/>\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"changed\\">\\n    Update\\n</div>\\n\\n1. UI Update\\n   - The detailed UI for validation has been updated.\\n   - The detailed UI for deployment history has been updated under Deployment > Deployment History.\\n\\n\\n</div>"},{"id":"/131","metadata":{"permalink":"/en/release/131","source":"@site/i18n/en/docusaurus-plugin-content-blog/131.mdx","title":"v1.3.1","description":"Support for AWS shared account credentials is available.","date":"2024-06-28T00:00:00.000Z","formattedDate":"June 28, 2024","tags":[],"readingTime":0.44,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.3.1","last_update":"2024-06-28T00:00:00.000Z","date":"2024-06-28T00:00:00.000Z"},"prevItem":{"title":"v1.4.0","permalink":"/en/release/140"},"nextItem":{"title":"v1.3.0","permalink":"/en/release/130"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Support for AWS shared account credentials is available.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. Support for AWS Shared Accounts\\n    - When registering AWS credentials, you can select between the owner account and shared accounts.\\n    - When selecting a shared account, you can enter a Session Token.\\n\\n</div>\\n<br/>\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"fixed\\">\\n    Fixed\\n</div>\\n\\n1. Import Infrastructure\\n    - The import error for some AWS resources has been fixed.\\n    - The import logic has been updated.\\n\\n</div>"},{"id":"/130","metadata":{"permalink":"/en/release/130","source":"@site/i18n/en/docusaurus-plugin-content-blog/130.mdx","title":"v1.3.0","description":"A new CSP has been added.","date":"2024-06-18T00:00:00.000Z","formattedDate":"June 18, 2024","tags":[],"readingTime":0.515,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.3.0","last_update":"2024-06-18T00:00:00.000Z","date":"2024-06-18T00:00:00.000Z"},"prevItem":{"title":"v1.3.1","permalink":"/en/release/131"},"nextItem":{"title":"v1.2.0","permalink":"/en/release/120"}},"content":"import styles from \'/src/scss/_markdown.module.scss\';\\n\\n<hr/>\\n\\n#### A new CSP has been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. NHN Cloud Service Offering\\n    - Supports NHN Cloud.\\n    - Provides limited functionality for diagrams, version control, vulnerability assessments, and deployment management.\\n\\n\\n</div>\\n<br/>\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"fixed\\">\\n    Fixed\\n</div>\\n\\n1. Export\\n   - The export feature has been modified to allow pre-deployment exports after deployment.\\n2. Resources\\n   - Ncloud: When modifying the Network Interface name, the priority on the server has been adjusted to remain unchanged.\\n3. Vulnerability Assessment\\n   - The items for vulnerability assessment compliance mapping have been updated.\\n\\n\\n</div>"},{"id":"/120","metadata":{"permalink":"/en/release/120","source":"@site/i18n/en/docusaurus-plugin-content-blog/120.mdx","title":"v1.2.0","description":"A new feature has been added.","date":"2024-06-01T00:00:00.000Z","formattedDate":"June 1, 2024","tags":[],"readingTime":0.38,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.2.0","last_update":"2024-06-01T00:00:00.000Z","date":"2024-06-01T00:00:00.000Z"},"prevItem":{"title":"v1.3.0","permalink":"/en/release/130"},"nextItem":{"title":"v1.1.0","permalink":"/en/release/110"}},"content":"import styles from \'/src/scss/_markdown.module.scss\';\\n\\n<hr/>\\n\\n#### A new feature has been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n1. Vulnerability Assessment Compliance Mapping\\n    - During vulnerability assessments, it displays control items for ISO 27001, ISMS-P, CSAP, and CSP stability evaluations.\\n    - The speed of vulnerability assessments has been improved.\\n2. Cost Calculation with Traffic Application\\n    - In addition to maintenance costs, you can input traffic for each resource and calculate the associated costs.\\n\\n</div>"},{"id":"/110","metadata":{"permalink":"/en/release/110","source":"@site/i18n/en/docusaurus-plugin-content-blog/110.mdx","title":"v1.1.0","description":"A new feature has been added.","date":"2024-05-01T00:00:00.000Z","formattedDate":"May 1, 2024","tags":[],"readingTime":0.395,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.1.0","last_update":"2024-05-01T00:00:00.000Z","date":"2024-05-01T00:00:00.000Z"},"prevItem":{"title":"v1.2.0","permalink":"/en/release/120"},"nextItem":{"title":"v1.0.0","permalink":"/en/release/100"}},"content":"import styles from \'/src/scss/_markdown.module.scss\';\\n\\n<hr/>\\n\\n#### A new feature has been added.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"feature\\">\\n    Feature\\n</div>\\n\\n\\n1. Import Infrastructure\\n   - You can visualize already deployed infrastructure by retrieving it.\\n   - Existing infrastructure can be converted into IaC and its state values can be generated for reuse. \\n2. Infrastructure Migration\\n   - You can migrate the configured infrastructure diagram to a different CSP (Cloud Service Provider).\\n   - During migration, it compares the mapped resources and costs.\\n\\n</div>"},{"id":"/100","metadata":{"permalink":"/en/release/100","source":"@site/i18n/en/docusaurus-plugin-content-blog/100.mdx","title":"v1.0.0","description":"Services are offered for Azure, AWS, Naver Cloud, and Kubernetes.","date":"2024-04-01T00:00:00.000Z","formattedDate":"April 1, 2024","tags":[],"readingTime":0.7,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"v1.0.0","last_update":"2024-04-01T00:00:00.000Z","date":"2024-04-01T00:00:00.000Z"},"prevItem":{"title":"v1.1.0","permalink":"/en/release/110"}},"content":"import styles from \\"/src/scss/_markdown.module.scss\\"\\n\\n<hr />\\n\\n#### Services are offered for Azure, AWS, Naver Cloud, and Kubernetes.\\n\\n<div className={styles.releaseWrap} >\\n<div className={styles.tag} data-type=\\"new\\">\\n    New\\n</div>\\n<div>\\n\\n1. Cloud Infrastructure Diagram\\n    - You can design cloud infrastructure with drag-and-drop functionality.\\n    - It provides real-time error feedback for incorrect configurations during infrastructure design.\\n    - Converts the designed infrastructure into Infrastructure as Code (IaC).\\n2. Version Control\\n    - Provides version control for IaC-based infrastructure, allowing you to revert to a specified version.\\n3. Cost Estimation\\n    - Offers monthly, daily, and hourly maintenance cost estimates for the designed infrastructure (in KRW, USD).\\n4. Vulnerability Assessment\\n    - Provides vulnerability assessments for the designed infrastructure, along with guides for addressing vulnerabilities.\\n5. Deployment Management\\n    - Validates the designed infrastructure through pre-deployment tests and integrates with cloud service providers\' credentials to deploy the actual infrastructure.\\n\\n</div>\\n</div>"}]}')}}]);